// Aboutscreen.js
import React, { Component } from "react";
import { Button, View, Text } from "react-native";
export default function TelecamereScreen() {
  return (
    <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Text>About Screen</Text>
    </View>
  );
}
